import { expect } from '@playwright/test'
import { test } from 'playwright-monaco'

test('JSON intellisense', async ({ editor, page }) => {
  await editor.evaluate(({ monaco }) => {
    monaco.languages.json.jsonDefaults.setDiagnosticsOptions({
      schemas: [
        {
          fileMatch: ['person.json'],
          uri: 'https://example.com/person.schema.json',
          schema: {
            type: 'object',
            properties: { givenName: { type: 'string', description: 'The persons given name' } }
          }
        }
      ]
    })
  })
  await editor.createModel('{"givenName": ""}', 'file:///person.json', true)
  await editor.setPosition({ lineNumber: 1, column: 8 })
  await editor.trigger('editor.action.showHover')
  await expect(page.locator('.hover-contents')).toHaveText('The persons given name')
})

import { expect, test } from '@playwright/test'
import { createServer } from 'playwright-monaco'

test('createServer', async () => {
  await expect(() =>
    // @ts-expect-error This tests invalid input.
    createServer({})
  ).rejects.toThrowError(new Error('Missing setup entry point'))
})
